import React from 'react';
import './Header.jsx';


const Header = () => {
	return <header className='header'>
		<img className='logo' alt={'Reliz-logo'}
			src='https://hhcdn.ru/ichameleon/229577.svg' />
	</header>;
}


export default Header;
